import React from 'react';
import UsersList from '../components/UsersList';


const Users=()=>{
    const USERS=[{id:"u1",name:'João Vitor',image:'https://media-cdn.tripadvisor.com/media/photo-s/06/ff/e7/42/praca-do-suspiro.jpg',places:1}];
    return <UsersList items={USERS}/>
};  

export default Users;
